  [],\n\t\"revision_timestamp\": \"2016-07-27T22:55:57.528808\",\n\t\"name\": \"bear-river-migratory-bird-refuge-annual-narrative-report-calendar-year-1992\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Bear River
  Migratory Bird Refuge outlines Refuge accomplishments during the 1992 calendar year.
  The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is discussed. The report includes a planning section which discusses
  the management plan, public participation, compliance with environmental and cultural
  resource mandates, and research and investigations. Refuge administration is outlined;
  information about personnel, volunteer programs, funding, and safety is given. Habitat
  management is also covered; subjects include wetlands and water rights. The wildlife
  section of the report discusses wildlife diversity, endangered and threatened species,
  waterfowl, marsh and water birds, raptors, other migratory birds, game mammals,
  fisheries resources, and disease prevention and control. The public uses of the
  Refuge described in this report include hunting, fishing, wildlife observation,
  and law enforcement. The equipment and facilities section of the report provides
  information about rehabilitation, equipment utilization and replacement, and computer
  systems. Items of interest are provided at the end. Photographs and brochures are
  attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
